import { Card } from "semantic-ui-react";

const ClassCard = (props) => {
  return (
    <div style={{ border: "solid black 1" }}>
      <h2>{props.classCode}</h2>
      <p>{props.classDesc}</p>
    </div>
  );
};

export default ClassCard;
